import React, {Component} from 'react'
import axios from "axios"

class Base extends Component{
    render(){
        return(
            <div className="headerContainer">
               <h1 style={textStyle}>the outer layer of the cerebrum<br/>
                (the cerebral cortex ), composed <br/>
                of folded grey matter and playing<br/>               
               an important role in consciousness.</h1>
               <img style={imageStyle} src="test-static/Cortex-Web.png" alt="Failed to load"/>
            </div>
        )
    }
}

const textStyle = {
   textAlign: "left",
   verticalAlign: "middle",
   fontSize: "20px",
   paddingLeft: "24px",
   lineHeight: "32px"
}
const imageStyle = {
   float: "right"
}
export default Base
